import React, { useState, useEffect } from "react";
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  TextField,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
} from "@mui/material";
import { useNavigate } from "react-router-dom";
import { createUserTasks } from "../Services/api";

const AddTaskDialog = ({ open, onClose }) => {
  const [newTask, setNewTask] = useState({
    Title: "",
    Description: "",
    Due_Date: "",
    Priority: "Medium",
    Status: "Pending",
  });
  const [validationError, setValidationError] = useState("");
  const [openLoginDialog, setOpenLoginDialog] = useState(false);
  const token = localStorage.getItem("token");
  const navigate = useNavigate();

  useEffect(() => {
    if (open && !token) {
      setOpenLoginDialog(true);
    }
  }, [open, token]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewTask({
      ...newTask,
      [name]: value,
    });
  };

  const handleSaveTask = async () => {
    if (!newTask.Title || !newTask.Description || !newTask.Due_Date || !newTask.Priority || !newTask.Status) {
      setValidationError("All fields are required");
      return;
    }
    try {
      if (token) {
        await createUserTasks(newTask);
        onClose(true);
      }
    } catch (error) {
      console.error("Error creating task:", error);
    }
  };

  const handleClose = () => {
    onClose(false);
  };

  const handleLoginDialogClose = () => {
    setOpenLoginDialog(false);
    navigate("/login");
  };

  return (
    <>
      <Dialog open={open} onClose={handleClose} fullWidth maxWidth="sm">
        <DialogTitle>Add New Task</DialogTitle>
        <DialogContent dividers>
          <TextField
            name="Title"
            value={newTask.Title}
            onChange={handleInputChange}
            fullWidth
            variant="outlined"
            label="Title"
            margin="normal"
            error={Boolean(validationError)}
          />

          <TextField
            name="Description"
            value={newTask.Description}
            onChange={handleInputChange}
            fullWidth
            variant="outlined"
            label="Description"
            margin="normal"
            error={Boolean(validationError)}
          />

          <TextField
            name="Due_Date"
            value={newTask.Due_Date}
            onChange={handleInputChange}
            type="date"
            fullWidth
            variant="outlined"
            label="Due Date"
            margin="normal"
            InputLabelProps={{
              shrink: true,
            }}
            error={Boolean(validationError)}
          />

          <FormControl fullWidth variant="outlined" margin="normal" error={Boolean(validationError)}>
            <InputLabel htmlFor="priority-select">Priority</InputLabel>
            <Select
              value={newTask.Priority}
              onChange={handleInputChange}
              label="Priority"
              inputProps={{
                name: "Priority",
                id: "priority-select",
              }}
            >
              <MenuItem value="Low">Low</MenuItem>
              <MenuItem value="Medium">Medium</MenuItem>
              <MenuItem value="High">High</MenuItem>
            </Select>
          </FormControl>

          {validationError && <p style={{ color: "red" }}>{validationError}</p>}
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="secondary">
            Cancel
          </Button>
          <Button onClick={handleSaveTask} color="primary">
            Add Task
          </Button>
        </DialogActions>
      </Dialog>

      {/* Dialog to prompt user to login */}
      <Dialog open={openLoginDialog} onClose={handleLoginDialogClose} fullWidth maxWidth="xs">
        <DialogTitle>Please Login</DialogTitle>
        <DialogContent>
          You need to login to add a task.
        </DialogContent>
        <DialogActions>
          <Button onClick={handleLoginDialogClose} color="primary">
            Go to Login
          </Button>
        </DialogActions>
      </Dialog>
    </>
  );
};

export default AddTaskDialog;
